    private static void makeAllRegionsTransparent() {
        for(GeographicRegion rgn:result){        
            MyColor fillColor=new MyColor(rgn.fillColor);
            rgn.fillColor=fillColor.scaleAlpha(0,1);            
        }
    }
    
    public static GeographyList create(){
        result=new GeographyList();        
        defineAmericanRegions();
        defineCanadianRegions();
        makeAllRegionsTransparent();          
        return result;
    }    

